import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.container}>
            <View style={styles.home_Box}>
                <Text style={styles.textStyle}>Services</Text>
                <Text>Show All</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        width: '100vw',
        height: '60vh',
        backgroundColor: "#fff",
    },
    home_Box: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-between',
        width: '90vw',
        height: '100vh',
        backgroundColor: "#fff",
        borderTopRightRadius: '5%',
        margin: 'auto',
        padding: "20px",
    },
textStyle:{
    color:"#102C56"
}
})

export default Home;
